script: |
  super -f text -I q4455.spq | sort > q4455.out

inputs:
  - name: q4455.spq
    data: |
      SELECT ALL 97 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT ( ( + col0 ) ) NOT BETWEEN NULL AND + col1 * + col2 / col2 + + CAST ( NULL AS INTEGER ) + + CAST ( NULL AS INTEGER ) / col2 / col2 + + - col1;
  - name: tab2

outputs:
  - name: q4455.out
    data: |
